  false,\n\t\"url\": null,\n\t\"notes\": \"Carp Control in refuge pools has been an
  important project during the last three years on Montezuma National Wildlife Refuge.
  The necessity for curtailing the carp population was evidenced by the increase of
  waterfowl use in the Main Pool after successful carp removal in 1953.  This report
  outlines the efforts of 1954 and also reviews the history of reducing the population
  of carp on the refuge.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
